import React from "react";
import logo from "../logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2> Mission Statement : </h2>
        <p>
          ‘Unnati’ (/oon -NAH -tee/) is a word of Sanskrit origin that means a
          lot of things: progress, elevation, rising, lifting up, or simply
          ‘ascending’. Unnati signifies our mission for this group, as we strive
          to help students progress constantly in their journey, so that they
          can reach their dreams with lesser obstacles in each path. Here at
          Unnati we can help you with a lot of things - adjusting to a new
          culture outside your home, turning culture-shocks from weird to a fun,
          new experiences, answering the questions you may find too ‘silly’ to
          ask someone else, making new friends, celebrating festivals, and so
          much more. Think of anything that a friend would do for you, and you
          can be rest assured Unnati will be that friend!
        </p>
      </header>
    </div>
  );
}

export default App;
